None of that addresses how women think nothing of excluding men due to their "lack of height" or the fact that women think nothing of voicing that.  "he's not tall enough" "he's too short".  But if a man said that about breast size we would be labeled as "pigs" or any number of things.  I'll say it again.  Height and breast size are both physical traits....why should women get a pass when it comes to desiring a tall guy but men are put down if we like larger breasts??? This obviously don't go for all women or men, but there is a great deal of truth to it for each on average.
